import { Route, Switch } from "react-router";
import Resume from "./Resume";
import Home from "./Home";

function Navigation() {
    return (
        /*<div className="Navigation">
            <h4>Home</h4>
            <h4>|</h4>
            <h4>Resume</h4>
            <h4>|</h4>
            <h4>Projects</h4>
            <h4>|</h4>
            <h4>Contact</h4>
        </div>*/
        <div>
            <Navigation />
            <Switch>
                <Route path="/" component={Home} exact/>
                <Route path='/resume' component={Resume}/>
            </Switch>
        </div>
    );
}

export default Navigation;
